import {ADD_NEW_MESSAGE, FETCHED_MESSAGES} from './actionsType';

export const addMessage = (data) =>{
    return{
        type:ADD_NEW_MESSAGE,
        payload:data
    };
};
export const addFetchedMessage = (data) =>{
    return{
        type:FETCHED_MESSAGES,
        payload:data
    };
};
